import React from "react";
import Main from "./main";

function NameList() {
  const users = [
    {
      id: 1,
      name: "Danil",
      age: 18,
      skill: "React and Solidity",
    },
    {
      id: 2,
      name: "Nurislam ",
      age: 18,
      skill: "Solidity and Kotlin",
    },
    {
      id: 3,
      name: "Aitaly",
      age: 17,
      skill: "Swift and Java, Kotlin on Androind ",
    },
    {
      id: 3,
      name: "Adil",
      age: 17,
      skill: "React and Java Script, also Node JS",
    },
  ];

  const nameList = users.map((user) => (
    <Main key={user.id} name={user.name} age={user.age} skill={user.skill}></Main>
  ));

  return <div>{nameList}</div>;
}

export default NameList;
